function loadProductDetails(productIndex) {
    var product = obj.results[productIndex];
    document.getElementById("main-img").src = product.productImg || "default-image.jpg";
    document.getElementById("product-name").textContent = product.productName;
    document.getElementById("product-price").textContent = product.productPriceFormatted;

    var swatchesContainer = document.getElementById("swatches-container");
    swatchesContainer.innerHTML = '';
   
    var maxVisible = 3;
    var allSwatches = [];

    if (product.productImg) {
        var mainSwatch = document.createElement("img");
        mainSwatch.className = "swatch";
        mainSwatch.src = product.productImg;
        mainSwatch.onclick = function () {
            document.getElementById("main-img").src = product.productImg;
        };
        swatchesContainer.appendChild(mainSwatch);
    }

    product.swatches.forEach(function (swatch, index) {
        var swatchElement = document.createElement("img");
        swatchElement.className = "swatch";
        swatchElement.src = swatch.img.src || "default-swatch.jpg";
        swatchElement.alt = swatch.swatchName;
        swatchElement.title = swatch.swatchName;
        swatchElement.onclick = function () {
            document.getElementById("main-img").src = swatch.img.src || "default-image.jpg";
        };
        allSwatches.push(swatchElement);
        if (index < maxVisible) {
            swatchesContainer.appendChild(swatchElement);
        }
    });

    if (allSwatches.length > maxVisible) {
        var moreButton = document.createElement("button");
        moreButton.innerText = "More";
        moreButton.className = "toggle-button";
        swatchesContainer.appendChild(moreButton);

        moreButton.onclick = function () {
            if (moreButton.innerText === "More") {
                allSwatches.slice(maxVisible).forEach(swatch => swatchesContainer.appendChild(swatch));
                swatchesContainer.appendChild(moreButton);
                moreButton.innerText = "Show Less";
            } else {
                allSwatches.slice(maxVisible).forEach(swatch => swatchesContainer.removeChild(swatch));
                moreButton.innerText = "More";
            }
        };
    }


    var thumbnailContainer = document.getElementById("thumbnail-container");
    thumbnailContainer.innerHTML = '';
    obj.results.forEach(function (item, index) {
        var thumbnailElement = document.createElement("img");
        thumbnailElement.className = "thumbnail";
        thumbnailElement.src = item.productImg || "default-thumbnail.jpg";  
        thumbnailElement.onclick = function () {
            loadProductDetails(index);
        };
        thumbnailContainer.appendChild(thumbnailElement);
    });
}

function increment() {
    let quantity = document.getElementById('quantity');
    quantity.textContent = parseInt(quantity.textContent) + 1;
}

function decrement() {
    let quantity = document.getElementById('quantity');
    if (parseInt(quantity.textContent) > 1) {
        quantity.textContent = parseInt(quantity.textContent) - 1;
    }
}

window.onload = function () {
    loadProductDetails(0);
};

document.addEventListener("DOMContentLoaded", function () {
    const dropdownTriggers = document.querySelectorAll(".dropdown-trigger");

    dropdownTriggers.forEach(trigger => {
        const dropdown = document.getElementById(trigger.dataset.dropdown);

        trigger.addEventListener("mouseenter", () => {
            dropdown.classList.add("active");
        });

        trigger.addEventListener("mouseleave", () => {
            setTimeout(() => {
                if (!dropdown.matches(":hover")) {
                    dropdown.classList.remove("active");
                }
            }, 300);
        });

    
    });

    const menuIcon = document.querySelector(".menu-icon");
    const navbarBottom = document.querySelector(".navbar-bottom");

    menuIcon.addEventListener("click", () => {
        navbarBottom.classList.toggle("active");
    });

    productsLink.addEventListener("click", function () {
        changeMenuContent("products");
    });
});


document.getElementById("search").addEventListener("input", function () {
    if (this.value.length > 0) {
    var searchValue = this.value.toLowerCase();
    var filteredProducts = obj.results.filter(product =>
        product.productName.toLowerCase().includes(searchValue)
    );

    var thumbnailContainer = document.getElementById("thumbnail-container");
    thumbnailContainer.innerHTML = '';

    filteredProducts.forEach((product, index) => {
        var thumbnailElement = document.createElement("img");
        thumbnailElement.className = "thumbnail";
        thumbnailElement.src = product.productImg || "default-thumbnail.jpg";
        thumbnailElement.onclick = function () {
            loadProductDetails(obj.results.indexOf(product));
        };
        thumbnailContainer.appendChild(thumbnailElement);
    });

    if (filteredProducts.length > 0) {
        loadProductDetails(obj.results.indexOf(filteredProducts[0]));
    }}
});
